import React, { useState } from 'react';
import './App.css';

function App() {
  const [loggedIn, setLoggedIn] = useState(false);

  const handleLoginClick = () => {
    setLoggedIn(!loggedIn); // login/ out。
  };

  return (
    <div className="App">
      {/* Header Navigation */}
      <header className="header">
        <div className="title">Destination Health</div>
        <nav className="nav">
          <a href="#home">Home</a>
          <a href="#how-to-book">How to book</a>
          <a href="#about-us">About us</a>
          <a href="#staff-portal">Staff Portal</a>
          {loggedIn ? (
            <div className="dropdown">
              <button className="profile-btn">
                <img src="https://via.placeholder.com/40" alt="profile" />
              </button>
              <div className="dropdown-content">
                <a href="#profile">Profile</a>
                <a href="#logout" onClick={handleLoginClick}>Log out</a>
              </div>
            </div>
          ) : (
            <button className="sign-in-btn" onClick={handleLoginClick}>Sign in</button>
          )}
        </nav>
      </header>

      {/* Slogan */}
      <section className="slogan">
        <h1>Healthcare made easy.</h1>
      </section>

      {/* Cards Section */}
      <section className="homepage-cards">
        <div className="card">
          <h2>New patient</h2>
          <button>Register</button>
        </div>
        <div className="card">
          <h2>Family Doctor</h2>
          <button>Book Now</button>
        </div>
        <div className="card">
          <h2>Walk in</h2>
          <button>Book Now</button>
        </div>
      </section>
    </div>
  );
}

export default App;
